%   Please see CASEFORMAT for details on the case file format.
%
%   This case accurately represents the size and complexity of the European
%   high voltage transmission network. The network contains 13,659 buses,
%   4,092 generators, and 20,467 branches and it operates at 750, 400, 380,
%   330, 220, 154, 150, 120, and 110 kV. Low voltage buses ranging from 
%   27,000 to 400 V are used to model step-up transformers which connect 
%   generators to the high-voltage network. Please note that the data are
%   fictitious and do not correspond to real world data. They can thus be
%   used to validate methods and tools but should not be used for operation
%   and planning of the European grid.
%
%   The data stems from the Pan European Grid Advanced Simulation and State
%   Estimation (PEGASE) project, part of the 7th Framework Program of the
%   European Union (http://www.fp7-pegase.com/).
%
%   When publishing results based on this data, please cite:
%
%     C. Josz, S. Fliscounakis, J. Maeght, and P. Panciatici, "AC Power Flow
%     Data in MATPOWER and QCQP Format: iTesla, RTE Snapshots, and PEGASE"
%     http://arxiv.org/abs/1603.01533
%
%     S. Fliscounakis, P. Panciatici, F. Capitanescu, and L. Wehenkel,
%     "Contingency ranking with respect to overloads in very large power
%     systems taking into account uncertainty, preventive and corrective
